import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
// USERS is an array of objects, which we need to convert into JSX (javascript components)
import { users } from "../data";


function Headline(users) {
    const employeeTable = users.map((users) => <li key={users.id}>{users.name}{users.department}{users.role}{users.email}</li> );

    return (
        <div>
            {employeeTable}
        </div>
    );
}

// convert array of objects to array of react components
